// MENU  BURGER
document.querySelector('.menu__burger').addEventListener('click' , function (event) {
    // event.preventDefault();
    let icon = document.querySelector('.menu__burger-logo');
    let nav = document.querySelector('.menu__burger-nav');
    if(event.target == icon || event.target.tagName == 'SPAN') {
        nav.classList.toggle('nav-box');
        icon.classList.toggle('active');
    }else if(event.target.tagName == 'A'){
        nav.classList.remove('nav-box');
        icon.classList.remove('active');
    }
    
    
})




