$(document).ready(function(){
    $('.what__sliders').slick({
        dots:false,
        arrows:true,
        fade:true
    });
})
 



//FULLPAGE OPTIONS 
let fadeR = document.querySelectorAll('.anime__faderight'),
    fadeRB = document.querySelectorAll('.anime__fadeRB'),
    fadeLB = document.querySelectorAll('.anime__fadeLB');



$('#fullpage').fullpage({
    //options here
    autoScrolling: true,
    scrollHorizontally: true,
    scrollOverflow: true,
    sectionSelector: '.section-all',
    anchors: ['header', 'what', 'advantage', 'property', 'accor', 'footer'],
    menu: '#menu',
    onLeave: function (index, nextIndex, direction) {
        if (nextIndex.index == 1 ) {
            for(let a of fadeR) {
                a.classList.toggle('animate__fadeInRight');
            };
        }else if(nextIndex.index == 2) {
            fadeLB[0].style.setProperty('--animate-duration', '0s');
            fadeRB[0].style.setProperty('--animate-duration', '1s');
            fadeLB[1].style.setProperty('--animate-duration', '2s');
            fadeRB[1].style.setProperty('--animate-duration', '3s');
            for (let a of fadeRB) {
                a.classList.toggle('animate__fadeInRightBig');
            };
            for (let a of fadeLB) {
                a.classList.toggle('animate__fadeInLeftBig');
            };
        } 
    }

    

});





// ACCORDION
document.querySelector('.accor .accordion').addEventListener('click' , function showText(e) {
    let texts = this.querySelectorAll('.accordion__text');
    let closeArr = this.querySelectorAll('.accordion__close');
    if (e.target.closest('.accordion__box')) {
        let box = e.target.closest('.accordion__box');
        let text = box.querySelector('.accordion__text'); 
        let close = box.querySelector('.accordion__close')
        if (text.classList.contains('accordion__text-active')) {
            text.classList.remove('accordion__text-active');
            close.classList.remove('active');
        }else{
            for (let a = 0; a < texts.length; a++) {
                if (texts[a].classList.contains('accordion__text-active')) {
                    texts[a].classList.remove('accordion__text-active')
                    closeArr[a].classList.remove('active')
                    
                }
            }
            text.classList.add('accordion__text-active');
            close.classList.add('active');
        }
        

    }
})



// tabs FOOTER CONTACTS
document.querySelector('.contacts .contacts__cities').addEventListener('click' , function showContats (e) {
    let tels = this.querySelectorAll('.contacts__cities-tell');
    let emails = this.querySelectorAll('.contacts__cities-email');
    let names = this.querySelectorAll('.contacts__cities-name');
    let items = this.querySelectorAll('.contacts__cities-item')
    if (e.target.classList.contains('contacts__cities-name')){
        let item = e.target.closest('.contacts__cities-item');
        let name = item.querySelector('.contacts__cities-name');
        let tell = item.querySelector('.contacts__cities-tell');
        let email = item.querySelector('.contacts__cities-email');

        if (tell.classList.contains('tabs-active')) {
            tell.classList.remove('tabs-active');
            email.classList.remove('tabs-active');
            name.classList.remove('name-active');
            item.classList.remove('item-active');

        }else {
            for (let index = 0; index < tels.length; index++) {
                tels[index].classList.remove('tabs-active');
                emails[index].classList.remove('tabs-active');
                names[index].classList.remove('name-active');
                items[index].classList.remove('item-active');
            }
            
            name.classList.add('name-active');
            tell.classList.add('tabs-active');
            email.classList.add('tabs-active');
            item.classList.add('item-active');

        }


        
    }
})